import React from 'react';
import { createRoot } from "react-dom/client";
import './index.css';
import 'mdb-react-ui-kit/dist/css/mdb.min.css';

import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

import Login from './pages/Authentication/LoginPage/Login';
import Signup from './pages/Authentication/SignupPage/Signup';
import Profile from './pages/ProfilePage/Profile';
import Dashboard from './pages/DashboardPage/Dashboard';
// import ErrorPage from "./error-page";

import App from './App';

import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";

import reportWebVitals from './reportWebVitals';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Login />,
    // errorElement: <ErrorPage />,
  },
  {
    path: "dashboard",
    element: <Dashboard />,
    // errorElement: <ErrorPage />,
  },
  {
    path: "signup",
    element: <Signup />,
    // errorElement: <ErrorPage />,
  },
  {
    path: "profile",
    element: <Profile />,
    // errorElement: <ErrorPage />,
  }
]);

const firebaseConfig = {
  apiKey: "AIzaSyB_fgH-gqRagjhIRoY6SUaKoxlgyzjPrIk",
  authDomain: "file-manager-1169c.firebaseapp.com",
  projectId: "file-manager-1169c",
  storageBucket: "file-manager-1169c.appspot.com",
  messagingSenderId: "627965509307",
  appId: "1:627965509307:web:0e4d1eee0cdb5fce1cf39e",
  measurementId: "G-50PEMH6L40"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);

const container = document.getElementById("root");
const root = createRoot(container);

root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
